import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App() {
  return (
    <div>
      <Header />
      {notes.map(myNote =>
      <Note 
        key = {myNote.key}
        title= {myNote.title}
        content= {myNote.content}
      />
)}
      <Footer />
    </div>
  );
}



export default App;
